import React from 'react';
import './App.css';
import QRScanner from './components/QRScanner/QRScanner';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div>
        <QRScanner />
      </div>
    </div>
  );
}

export default App;
